import Layout from "../components/Layout";
import phones from "../database/index";
import { v4 as uuidv4 } from "uuid";

const Index = () => {
  const renderPhones = () => {
    const phoneList = phones.map(phone => {
      return (
        <li key={uuidv4()}>
          <div>
            <a>{phone.name}</a>
          </div>
          <ul>
            <li>{newFunction(phone)()}</li>
          </ul>
        </li>
      );
    });
    return phoneList;
  };

  return (
    <Layout>
      <div className="body">
        <ul>{renderPhones()}</ul>
      </div>
    </Layout>
  );
};

